import React, { useState, useEffect } from "react";

const Preview3DApi = ({miDent}) => {
    const [data, setData] = useState(null);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const params = {
                    // mident: miDent,
                    mident: '{bosch_rexroth_cytro/power_units/std_power_units/cytropac_asmtab.prj},013 {LINEID=10} {NB=BOSCH-Rexroth CYTROPAC-1X/20/AF1AS04/2/B/WA/1/7035}, {TYP=CYTROPAC: Hydraulic power unit},{CS=1X: Component series 10 to 19},{TS=20: 20 Litre},{DR=AF}, {PC=1},{PM=AS04},{OP=2: Maximum operating pressure},{ST=E}, {CT=WA},{FL=1: Return flow filter},{COL=7035: RAL 7035},{FD=UL}, {PPATH=cytropac_asmtpl.prj},{BAH005=380},{AAF726=8.3},{AAB456=4000},{BAD915=AC},{AAC830=20},{BAC676=G1}, {AAN523=Plug-in connection},{AAG402=1},{AAQ326=https://www.boschrexroth.com/ics/cat/?cat=Industrial-Hydraulics-Catalog&p=p943945}, {AAJ413=G1},{BAI539=},{BAB706=}',
                    apikey: 'e66120f9d9624823884cac1bf290ea88',
                    language: 'english',
                    format: 'PARTJAVA3D',
                    preferformat: 'PARTJAVA3D',
                };
                const queryString = new URLSearchParams(params).toString();
                const url = `https://webapi.partcommunity.com/service/preview3d?${queryString}`;
                const response = await fetch(url);
                
                console.log('Response status:', response.status);

                const responseBody = await response.text();
                console.log('Response body:', responseBody);

                if (!response.ok) {
                    throw new Error(`Failed to fetch data: ${response.statusText}`);
                }
                
                setData(responseBody); // Set the response body as data
            } catch (error) {
                console.error('Error fetching the data', error);
                setError('Error fetching the data. Please try again later.');
            }
        };

        fetchData();
    }, [miDent]);

    if (error) {
        return <div>{error}</div>;
    }

    if (!data) {
        return <div>Loading...</div>;
    }

    return (
        <div>
            <pre>{data}</pre>
        </div>
    );
};

export default Preview3DApi;
